import React from 'react';
import './DiscoverTrailers.css';

function TrailerList(props){

      
    const style={
        backgroundImage:`url('https://image.tmdb.org/t/p/original${props.tv.backdrop_path}')`
         };
    return(
        
        <div className="browse-movies">
                   
            <div className="movie-picture" style={style}>
            <div className=" vote fa fa-heart">{"  "+ props.tv.vote_average}</div>
            <div className="watch">
            <button>watch</button></div>
            </div>
            
            <div className="movie-details">{props.tv.title}</div>
            
        </div>
    )
};

export default TrailerList;
